import React from 'react';

const Pagination = () => {
  return (
    <div>
         <section class="pagination">
            <div>
                <a href="#" class="number">1</a>
                <a href="#" class="number">2</a>
                <a href="#" class="number icon"><i class="fa-solid fa-arrow-right-long"></i></a>
            </div>
        </section>

    </div>
  )
}

export default Pagination;
